import React from 'react';
import './custom-btn.styles.scss'

const Custombtn=({children,googlesign,small,...otherprops})=>(
    <button className={  
        //if googlesign passed as props it will true otherwise false
        ` 'custom-button' ${googlesign ? 'googlesign' : ''} ${small ? 'small-font' : ''}`} {...otherprops}>{children.toUpperCase()}</button>
)

export default Custombtn;
